import React, {memo, useCallback} from 'react';
import styled from 'styled-components';
import dataset from '../dataset';

const HeaderContainer = styled.div`
    font-family: 'Noto Sans KR', sans-serif;
    /* background-color: #ff05; */
    padding:20px 0;
    position: static;
    width:100%;
    height:120px;

    .navInner{
      max-width:1200px;
      /* background-color: #f60; */
      margin:0 auto;

      .topMenu{
        display: flex;
        justify-content: right;
        align-items: center;
        
        li{
          margin-left:10px;
          font-size:14px;

          &:first-child::after{
            content: "|";
            margin-left:10px;
            color:#555;
          }

          a{
            color:#555;
          }
        }
      }

      .navWrap{
        display: flex;
        align-items: center;
        justify-content: space-between;
        position: relative;

        .navItem{
          width:100%;
          height:100%;
          display: flex;
          align-items: center;

          .link{
            height:100%;
            width:80px;
            margin:0 20px;

            /* padding:0 20px; */
            

            a{
              font-size:16px;
              position: relative;
            }

            .navHoverWrap{
              background-color: #ffe600;
              width:max-content;
              /* position: relative; */
              position: absolute;
              /* top:80px;
              left:0; */
              left:0;
              top:0;
              z-index:999999999999;
              display: flex;
              flex-direction: column;
              overflow: hidden;
              max-height:0;
              transition: max-height 300ms;

              .navHoverItem{
                padding:40px;

                li{
                  margin-bottom:10px;

                  &.last-child{
                    margin-bottom:0;
                  }
                }
              }
            }
          }
        }
      }
    }
`;

const Header = memo(() => {
  const {header} = dataset;
  // console.log(header);

  const onMenuItemOver = useCallback((e) =>{
    e.preventDefault();
    const current = e.currentTarget;

    const index = Array.from(current.parentNode.children).indexOf(current);
    // console.log(index);

    const hover = current.querySelector('.navHoverWrap');
    // console.log(hover);
    hover.style.maxHeight = hover.scrollHeight + 'px';
    // console.log(hover.scrollHeight);
  }, []);

  const onMenuItemOut = useCallback((e) =>{
    e.preventDefault();
